A4サイズ 2枚入り／インクジェットプリンタ用<table border="0" width=" 595" id="ItemInfo"><tr><td width="100%"><font size="2">◆インクジェットプリンタで印刷できる、コットン製の布（クロス）です。<BR><BR>◆コットン生地に特別な加工を施しているので、にじみがなく美しい仕上がりです。<BR><BR>◆裏面にPETフィルムをラミネート加工してあるため、プリンタ内で汚れたりひっかかったりせずに印刷できます。<BR>※印刷後、PETフィルムをはがしてから縫製等の加工を行ってください。<BR><BR>◆織り目が細く軽く薄いため、縫製加工がしやすくなっています。<BR><BR>◆市販されていないあなただけのオリジナルの模様を印刷して、オリジナルのキルトやぬいぐるみが作成できます。<BR><BR>◆実用耐水性があり、汚れた場合は簡単な水洗いも可能です。(洗剤は使用不可)<BR>※使用する前に一度さっと水洗いをし、余分なインクを洗い流して下さい。この作業をしないと雨など部分的な水ぬれによりにじみが生じる恐れがあります。<br><br><TABLE border="1" cellspacing="1" cellpadding="4" width="100%" bordercolor="#111111" style="border-collapse: collapse"><tr><td width=180 bgcolor ="#F0F0F0"><font size="2">シートサイズ</td><td width=400><font size="2"> A4（210×297mm）</td></tr><tr><td width=180 bgcolor ="#F0F0F0"><font size="2">入数</td><td width=400><font size="2"> 2シート</td></tr><tr><td width=180 bgcolor ="#F0F0F0"><font size="2">紙厚</td><td width=400><font size="2"> 0.34±0.05mm（布のみ/0.28±0.05mm）</td></tr><tr><td width=180 bgcolor ="#F0F0F0"><font size="2">種類</td><td width=400><font size="2">その他プリンタ用紙＞ その他</td></tr></TABLE></font></TABLE></td></tr></table><style type="text/css">
